import React from 'react';
import Tilt from 'react-tilt';
import './Logo.css';
import icon from './brain-icon.png'

const Logo = () => {
    return (
        <div className='ma4 mt0'>
            <Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: auto, width: 120 }} >
                <div className="Tilt-inner pt3"> 
                    <img src={icon} alt='icon' /> 
                </div>
            </Tilt>
        </div>
    );
}

export default Logo;
